import React from 'react'
import { ReactDOM } from 'react';
import { render } from 'react-dom';


const TestData = {
        "id": 1,
        "testName": "Are you seek?",
        "description": "Yes",
        "questions": [
        {
            "id": 1,
            "question": "Why are you worked there",
            "subanswers": [
                {
                    "id": 1,
                    "answer": "This is me",
                    "score": 99
                }
            ]
        },
        {
            "id": 4,
            "question": "Is not a quest",
            "subanswers": []
        },
        {
            "id": 3,
            "question": "Is a quest",
            "subanswers": []
        }
    ]
}




let TestName;
let TestDesc;

const questions = TestData.questions.map(item => {
    const res = [item.question];
    item.subanswers.forEach(subItem => res.push([subItem.answer, subItem.score]));
    return (res);
});

alert(questions);

let listItems = [];
for (let i of questions) {
    let l = 0;
    for (let k of i) {
        if(l==0){
            listItems.push(<div>{k}</div>)
        }
        else{
            listItems.push(<div><div>{k[0]}</div><div>{k[1]}</div></div>)
        }
        l++;
    }
}

const Item = (
    <div>
    </div>
);



export const TestReady = () => {
    return (
      <div className='Content'>
        <div className="Create">
            <div className="CreateHeader">
                <h1>Составь вопросы</h1>
                <div className="MainCreate">
                    <img src={'./img/createtest.jpg'} alt="" className='CreateImg'/>
                    <div className="CreateQuestions">
                        <form>
                            <p>Название</p>
                            <div className="QuestMessage">{TestName}</div>
                            <p>Описание</p>
                            <div className="QuestMessage">{TestDesc}</div>
                        </form>
                    </div>
                    <div className="AnswerSelect">
                            <p1>Вопрос?</p1>
                            <form>

                                <div className="form-check">
                                    <label>
                                    <input
                                        type="radio"
                                        name="react-tips"
                                        value="quest1"
                                        checked={true}
                                        className="form-check-input"
                                    />
                                    Question 1
                                    </label>
                                </div>

                                <div className="form-check">
                                    <label>
                                    <input
                                        type="radio"
                                        name="react-tips"
                                        checked={true}
                                        value="quest2"
                                        className="form-check-input"
                                    />
                                    Question 2
                                    </label>
                                </div>

                                <div className="form-check">
                                    <label>
                                    <input
                                        type="radio"
                                        name="react-tips"
                                        checked={true}
                                        value="quest3"
                                        className="form-check-input"
                                    />
                                    Question 3
                                    </label>
                                </div>

                                <div className="form-group">
                                    <button className="q_create_form" type="submit">
                                    Save
                                    </button>
                                </div>

                            </form>                              
                        </div>
                </div>
            </div>
        </div>
      </div>
    )
    
  }
